import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import { Dashboard, SignIn, Admin, Roles, Customers, Settings } from "../pages";
import { DataGivers } from "../pages/Customers/DataGivers";
import { Details } from "../pages/Customers/Details";
import { OystrSmartCustomers } from "../pages/Customers/OystrSmartCustomers";
import { RequiredAuthDashboard } from "./RequiredAuth";

const Index = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignIn />} />
        <Route element={<RequiredAuthDashboard />}>
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/admin" element={<Admin />} />
          <Route path="/roles" element={<Roles />} />
          <Route path="/customers/data-consumers" element={<Customers />} />
          <Route path="/customers/data-givers" element={<DataGivers />} />
          <Route
            path="/customers/oystr-smart-costumers"
            element={<OystrSmartCustomers />}
          />
          <Route path="/customers/:id" element={<Details />} />
          <Route path="/settings" element={<Settings />} />
        </Route>
      </Routes>
    </Router>
  );
};

export default Index;
